import React from "react";
import { Link } from "react-router-dom";

export default class Header extends React.Component() {
render() {
    return (
        <div className="section-container">
            <nav>
                <ul>
                    <li>
                        <Link to="/">Home</Link>
                    </li>
                </ul>
            </nav>
        </div>
    )
}
}
